script: |
  super -f text -I q2443.spq | sort > q2443.out

inputs:
  - name: q2443.spq
    data: |
      SELECT ALL + 20 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( NOT + col1 / 92 < + col0 ) OR + CAST ( - col1 AS INTEGER ) IS NULL;
  - name: tab0

outputs:
  - name: q2443.out
    data: |
      20
      20
      20
